import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import './AssessmentDashboard.css';

const AssessmentDashboard = ({ user }) => {
  const navigate = useNavigate();
  const location = useLocation();

  // Get assessment data from navigation state or location state
  const assessmentData = location.state?.assessmentData || {
    respondentName: 'N/A',
    organisation: 'N/A',
    city: 'N/A',
    borough: 'N/A',
    ward: 'N/A',
    createdAt: new Date(),
  };

  // Format the created date
  const formatDate = (date) => {
    if (!date) return 'N/A';
    try {
      // Handle Firestore Timestamp
      const d = date.toDate ? date.toDate() : (date instanceof Date ? date : new Date(date));
      if (isNaN(d.getTime())) return 'N/A';
      return d.toLocaleString('en-US', {
        month: 'short',
        day: 'numeric',
        year: 'numeric',
        hour: '2-digit',
        minute: '2-digit',
      });
    } catch (e) {
      return 'N/A';
    }
  };

  const handleViewDashboard = () => {
    navigate('/');
  };

  const handleBackToInfo = () => {
    navigate('/assessment');
  };

  return (
    <div className="assessment-dashboard">
      <div className="dashboard-header">
        <div className="header-left">
          <div className="logo-container">
            <div className="logo-icon">
              <svg width="48" height="48" viewBox="0 0 48 48" fill="none">
                <rect x="8" y="6" width="32" height="36" rx="2" fill="#3b82f6" stroke="#2563eb" strokeWidth="2"/>
                <line x1="14" y1="14" x2="34" y2="14" stroke="#ffffff" strokeWidth="2" strokeLinecap="round"/>
                <line x1="14" y1="20" x2="34" y2="20" stroke="#ffffff" strokeWidth="2" strokeLinecap="round"/>
                <line x1="14" y1="26" x2="28" y2="26" stroke="#ffffff" strokeWidth="2" strokeLinecap="round"/>
              </svg>
            </div>
            <div className="logo-text">
              <div className="logo-title">SAFE</div>
              <div className="logo-subtitle">Smart Age-Friendliness Evaluation Platform</div>
              <div className="logo-lab">Future Cities and Assistive Technology Lab</div>
            </div>
          </div>
        </div>

        <div className="header-right">
          <div className="info-panel">
            <div className="info-item">
              <span className="info-label">Respondent:</span>
              <span className="info-value">{assessmentData.respondentName || 'N/A'}</span>
            </div>
            <div className="info-item">
              <span className="info-label">Organization:</span>
              <span className="info-value">{assessmentData.organisation || 'N/A'}</span>
            </div>
            <div className="info-item">
              <span className="info-label">Location:</span>
              <span className="info-value">
                {[assessmentData.city, assessmentData.borough, assessmentData.ward]
                  .filter(Boolean)
                  .join(', ') || 'N/A'}
              </span>
            </div>
            <div className="info-item created">
              <span className="info-label">Created:</span>
              <span className="info-value">{formatDate(assessmentData.createdAt)}</span>
            </div>
          </div>
        </div>
      </div>

      <div className="dashboard-content">
        <div className="dashboard-buttons">
          <button className="btn-view-dashboard" onClick={handleViewDashboard}>
            <svg className="btn-icon" width="20" height="20" viewBox="0 0 20 20" fill="none">
              <path d="M3 3h6v6H3V3zm8 0h6v6h-6V3zM3 11h6v6H3v-6zm8 0h6v6h-6v-6z" fill="currentColor"/>
            </svg>
            View Dashboard
          </button>

          <button className="btn-back-info" onClick={handleBackToInfo}>
            <svg className="btn-icon" width="20" height="20" viewBox="0 0 20 20" fill="none">
              <path d="M12 15l-5-5 5-5" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
            Back to Info
          </button>
        </div>
      </div>
    </div>
  );
};

export default AssessmentDashboard;
